import React, { useState } from 'react'
import Input from '../Components/Input'

const Signup = () => {
    const [inputs,setInputs]=useState({})
    const handleSubmit=(e)=>{
        e.preventDefault()
    }
    const handleCompany=()=>{
        
    }
    const handleJob=()=>{
        
    }
    const handleContinue=()=>{
        
    }
  return (
    <section className='sec signup'>
        <div className='signupCon'>
            <h1>SignUp</h1>
            <div className='processBar'>
                <div className='num' id='num1'><i class="fa-solid fa-lg fa-1"></i></div><div className='line' id="line1"></div><div className='num' id='num2'><i class="fa-solid fa-lg fa-2"></i></div><div className='line' id='line2'></div><div className='num' id='num3'><i class="fa-solid fa-lg fa-3"></i></div>
            </div>
            <form onSubmit={handleSubmit}>
                <div className='general'>
                    <Input
                        name="Email"
                        placeholder="Email"
                        inputs={inputs}
                        setInputs={setInputs}
                    />
                    <Input
                        name="Password"
                        placeholder="Password"
                        inputs={inputs}
                        setInputs={setInputs}
                    />
                    <p>You are ?</p>
                    <div className='buttons'>
                        <button onClick={handleCompany}>Company</button>
                        <button onClick={handleJob}>Job Seeker</button>
                    </div>
                </div>
                <div className='company'>
                    <Input
                        name="CompanyName"
                        placeholder="Company's Name"
                        inputs={inputs}
                        setInputs={setInputs}
                    />
                    <Input
                        name="Location"
                        placeholder="Location"
                        inputs={inputs}
                        setInputs={setInputs}
                    />
                    <Input
                        name="Field"
                        placeholder="Field of Interesset"
                        inputs={inputs}
                        setInputs={setInputs}
                    />
                    <Input
                        name="numEmpl"
                        placeholder="Number of Employees"
                        inputs={inputs}
                        setInputs={setInputs}
                    />
                    <div className='buttons'>
                        <button onClick={handleContinue}>Continue</button>
                    </div>
                </div>
                <div className='job'>
                    <Input
                        name="firstName"
                        placeholder="First Name"
                        inputs={inputs}
                        setInputs={setInputs}
                    />
                    <Input
                        name="lastName"
                        placeholder="Last Name"
                        inputs={inputs}
                        setInputs={setInputs}
                    />
                    <Input
                        name="Field"
                        placeholder="Field of Interesset"
                        inputs={inputs}
                        setInputs={setInputs}
                    />
                    <Input
                        name="number"
                        placeholder="Phone Number"
                        inputs={inputs}
                        setInputs={setInputs}
                    />
                    <div className='buttons'>
                        <button onClick={handleContinue}>Continue</button>
                    </div>
                </div>
                <div className='last'>
                    <div>
                        <h1>Do You Agree to Receive Emails from our part?</h1>
                        <div></div>
                    </div>
                </div>
            </form>
        </div>
    </section>
  )
}

export default Signup
